;================================ TRANSPORTS ==
; Our primary transport definition for UDP communication behind NAT.
[transport-udp-nat]
type = transport
protocol = udp
bind = 0.0.0.0:5600

[transport-tcp-nat]
type = transport
protocol = tcp
bind = 0.0.0.0:5700

[transport-ws-nat]
type = transport
protocol = ws
bind = 0.0.0.0:3016



; NAT settings
;local_net = 10.0.0.0/8
;external_media_address = 203.0.113.1
;external_signaling_address = 203.0.113.1

